import React, { Component } from 'react';
import './App.css';
import Movie from './Movie';

class App extends Component {

  state = {
    movies: [{
      title:"Movie1",
      poster:"http://upload2.inven.co.kr/upload/2017/07/28/bbs/i16326417659.png"
    },{
      title:"Movie2",
      poster:"data:image/jpeg;base64,"
    },{
      title:"Movie3",
      poster:"http://upload2.inven.co.kr/upload/2017/07/28/bbs/i16326417659.png"
    },{
      title:"Movie4",
      poster:"data:image/jpeg;base64,"
    }]
  }

  componentDidMount(){
    setTimeout(()=>{
      this.setState({
        movies:[
          ...this.state.movies,
          {
            title:"new movie",
            poster:"data:image/jpeg;base64,"
          }
        ]

      })
    },3000)
  };

  render() {
    return (
      <div className="App">
        {this.state.test}
        {this.state.movies.map((movie, index) =>{
          return <Movie title={movie.title} poster={movie.poster} key={index}/>
        })}
      </div>
    );
  }
}

export default App;